description:
Work sucks... and so does my boss! I'm working for this French company for more than a year, and believe me, some of the strangest things are happening in our office during night shift. A little office overwork... a whole lot of fun! So why don't you join our little crew? But make sure the French boss doesn't know about our dirty little games with the accounts and secretaries...!
